INSERT INTO `eventos` VALUES (639548,2,'inscricoesencerradas','ECOTRILHAS VENDA NOVA DO IMIGRANTE / ES','ecotrilhas-venda-nova-do-imigrante-es','124.00',NULL,'<p><span style=\"font-size:16px\">INFORMA&Ccedil;&Atilde;O IMPORTANTE&nbsp;</span></p>\r\n\r\n<p>ANTES DE EFETUAR A SUA INSCRI&Ccedil;&Atilde;O LEIA O REGULAMENTO</p>\r\n\r\n<p><a href=\"http://ecotrilhasbrasil.com.br/2015/regulamento-ecotrilhas/\">http://ecotrilhasbrasil.com.br/2015/regulamento-ecotrilhas/</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"color:#ff0000\"><u><strong>&nbsp;INSCRI&Ccedil;&Atilde;O:</strong></u></span></p>\r\n\r\n<p>&nbsp;1&ordm; LOTE R$ 124,00 PARA PAGAMENTO AT&Eacute; O DIA 20/10/2016</p>\r\n\r\n<p>2&ordm; LOTE R$ 140,00 PARA PAGAMENTO AT&Eacute; O DIA 31/10/2016</p>\r\n\r\n<p>3&ordm; LOTE R$ 165,00 PARA PAGAMENTO AT&Eacute; O DIA 10/11/2016</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"color:#ff0000\"><u><strong>INCLUSO:</strong></u></span></p>\r\n\r\n<ul>\r\n\t<li>01 PLACA PARA BIKE</li>\r\n\t<li>01 PULSEIRA DE IDENTIFICA&Ccedil;&Atilde;O</li>\r\n\t<li>01 LANCHE COLONIAL DURANTE O PERCURSO</li>\r\n\t<li>&Aacute;GUA DURANTE O PERCURSO</li>\r\n\t<li>ISOT&Ocirc;NICOS DURANTE&nbsp;</li>\r\n\t<li>01 ALMO&Ccedil;O</li>\r\n\t<li>FRUTAS DURANTE O PERCURSO</li>\r\n\t<li>SEGURO</li>\r\n\t<li>APOIO DURANTE O PERCURSO</li>\r\n</ul>\r\n\r\n<p><span style=\"color:#ff0000\">N&Atilde;O REALIZAREMOS INSCRI&Ccedil;&Otilde;ES NO DIA DO EVENTO</span></p>\r\n\r\n<p><span style=\"color:#ff0000\"><u><strong>KIT</strong></u></span></p>\r\n\r\n<p><span style=\"color:#0000ff\">PARA RETIRADA DO KIT SER&Aacute; NESCESS&Aacute;RIO A DOA&Ccedil;&Atilde;O DE 02 KILOS DE ALIMENTOS N&Atilde;O PEREC&Iacute;VEIS QUE SER&Aacute; DOADO PARA UMA INSTITUI&Ccedil;&Atilde;O LOCAL</span></p>\r\n\r\n<p><span style=\"color:#ff0000\">IDADE MIN&Iacute;MA 15 ANOS COM AUTORIZA&Ccedil;&Atilde;O DOS RESPONSAVEIS</span></p>\r\n\r\n<p>PARA MAIORES INFORM&Ccedil;&Otilde;ES ACESSE:<a href=\"http://2015.ecotrilhasbrasil.com.br/\">WWW.ECOTRILHASBRASIL.COM.BR</a></p>','87049a0db4b02bc922afd672b81aa5d2.jpg',NULL,'VENDA NOVA DO IMIGRANTE ',NULL,NULL,'2016-11-13','Venda Nova do Imigrante, Colônia Italiana na região de Montanhas Capixabas, é considerada a “Capital Nacional do Agroturismo”. Pólo Agroturístico e com vocação para os esportes de aventura.'),(639550,2,NULL,'ECOTRILHAS CAPARAÓ 2017','ecotrilhas-caparao-2017','65.00',NULL,'<h2>REGULAMENTO</h2>\r\n\r\n<p>Antes de se inscrever leia o regulamento <a href=\"http://www.ecotrilhasbrasil.com.br\" target=\"_blank\"><strong>www.ecotrilhasbrasil.com.br</strong></a></p>\r\n\r\n<p><a class=\"btn btn-success btn_inscricao\" href=\"/eventos/639550\">Inscrever</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>INSCRI&Ccedil;&Atilde;O: <strong>R$ 65,00</strong></p>\r\n\r\n<h2>INCLUSO:</h2>\r\n\r\n<ul>\r\n\t<li>01 CAMISA DE BIKE PARA OS <strong>100 PRIMEIROS</strong> INSCRITOS</li>\r\n\t<li>01 ALMO&Ccedil;O</li>\r\n\t<li>01 LANCHE</li>\r\n\t<li>&Aacute;GUA DURANTE O PERCURSO</li>\r\n\t<li>ISOT&Ocirc;NICO DURANTE O PERCURSO</li>\r\n\t<li>01 PLACA PARA BIKE</li>\r\n\t<li>01 PULSEIRA DE IDENTIFICA&Ccedil;&Atilde;O</li>\r\n\t<li>SEGURO</li>\r\n\t<li>APOIO DURANTE O PERCURSO</li>\r\n</ul>','16e4b448c94ff8187053e7d5b1b65f33.jpg',NULL,'GUAÇUÍ - ES',NULL,NULL,'2017-07-16','AO SE INSCREVER O PARTICIPANTE DEVERÁ ESTAR DE ACORDO COM O REGULAMENTO.\r\nwww.ecotrilhasbrasil.com.br');

